"use strict";

const AdminModule = lacoLib('./libs/admin/module');

class Test extends AdminModule {
    constructor(laco) {
        super(laco);
        this.registerViews([
            'main'
        ]);

        this.registerMenus([
            {
                name: 'test_main',
                anchor: 'Test',
                link: this.link(),
                icon: '<i class="zmdi zmdi-badge-check"></i>',
                priority: -1
            }
        ]);
    }

    main(req, res) {
        this.view('main', {}, req, res);
    }
}
module.exports = Test;
